import React from 'react';
import { Container, Typography, Grid, Paper, Button, Box, AppBar, Toolbar, IconButton, Menu, MenuItem, CssBaseline } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon } from '@mui/icons-material';
import { Link } from 'react-router-dom';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function UserDashboard() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <MenuIcon />
          </IconButton>
          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleMenuClose}>
            <MenuItem component={Link} to="/showcase" onClick={handleMenuClose}>Showcase</MenuItem>
            <MenuItem component={Link} to="/pricing" onClick={handleMenuClose}>Pricing</MenuItem>
          </Menu>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg" sx={{ mt: 4, textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          User Dashboard
        </Typography>
        <Typography variant="h6" gutterBottom>
          Welcome to your dashboard. Here you can manage your account and view your activity.
        </Typography>
        <Grid container spacing={4} padding={4}>
          <Grid item xs={12} md={4}>
            <Paper sx={{ p: 3, backgroundColor: 'background.paper' }}>
              <Typography variant="h5" gutterBottom>
                Account Details
              </Typography>
              <Typography variant="body1" gutterBottom>
                View and update your account details.
              </Typography>
              <Button variant="outlined" color="inherit">
                Manage Account
              </Button>
            </Paper>
          </Grid>
          <Grid item xs={12} md={4}>
            <Paper sx={{ p: 3, backgroundColor: 'background.paper' }}>
              <Typography variant="h5" gutterBottom>
                Activity
              </Typography>
              <Typography variant="body1" gutterBottom>
                View your recent activity and usage statistics.
              </Typography>
              <Button variant="outlined" color="inherit">
                View Activity
              </Button>
            </Paper>
          </Grid>
          <Grid item xs={12} md={4}>
            <Paper sx={{ p: 3, backgroundColor: 'background.paper' }}>
              <Typography variant="h5" gutterBottom>
                Support
              </Typography>
              <Typography variant="body1" gutterBottom>
                Get help and support for any issues you may have.
              </Typography>
              <Button variant="outlined" color="inherit">
                Contact Support
              </Button>
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default UserDashboard;
